import React from "react";
import './Styles.css';

function Nav_bar() {
    return (
        <div class="app">
            <header class="app-header">
                <header class="app-header navbar">
                    <button class="navbar-toggler" type="button">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                </header>
            </header>
        </div>





    );
}

export default Nav_bar
